import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home';
import AboutView from './components/AboutView';
import { Routes, Route } from 'react-router-dom';


function App() {
  return (
    <div>
      <Navbar/>


      <Route path="/about" component={AboutView} />
      <Routes>
      <Route path="/" exact>
          <Home/>
        </Route>
          <Route path="/about" component={<AboutView />} />
        </Routes>

    </div>
  );
}

export default App;
